import React from "react";
import { NavLink } from "react-router-dom";
import routes from "../utils/utils";

export default function AuthNav() {
  return (
    <div>
      <NavLink to={routes.register} exact>
        Register
      </NavLink>
      <NavLink to={routes.login} exact>
        Login
      </NavLink>
    </div>
  );
}
